import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="h-screen flex justify-center items-center flex-col bg-slate-100">
        <div className="bg-primary  h-auto w-1/4 border rounded-xl"> 
        <div></div>
        <hr className='border border-x-8 border-stone-600' />

        </div>
      </div>
    </div>
  );
}

export default App;
